    /*
      recherche sur wikipédia du texte sur lequel on a cliqué
    */
    rechercheText(text) {
      const that = this;
      const oReq = new XMLHttpRequest();
      oReq.addEventListener("error", (e) => {
        console.log(e);
      });
      oReq.open('GET', "https://fr.wikipedia.org/w/api.php?action=query&list=search&origin=*&utf8&format=json&srlimit=50&srsearch=métro%20Paris%20" + text, true)

      // Once request has loaded... 
      oReq.onload = function() {
        // Parse the request into JSON
        const data = JSON.parse(this.response);
        // Log the data object 
        //console.log(data);

        let page = data.query.search[0].title;
        for (let i = 0; i < data.query.search.length; i++) { 
          const titleResultSearch = data.query.search[i].title;
          let substring = "(métro de Paris)";
          if (titleResultSearch.indexOf(substring) > -1) {
            page = data.query.search[i].title;
            break;
          }
        }
        that.recuperationPageResultats(page);
      }
      oReq.send();
    },

    /*
      récupération de la page des résultats de recherche correspondant à la station de métro
    */
    recuperationPageResultats(page) {
      const that = this;
