        for (let i = 0; i < tableauImages.length; i++) { 
          tableauImagesTitle = tableauImages[i].title;
          const substring1 = "Fichier:Metro";
          const substring2 = "Station";
          const substring3 = "Quais";
          const substring4 = "Fichier:Métro";
          
          if (((tableauImagesTitle.indexOf(substring1) > -1 || 
