              tableauImagesTitle.indexOf(substring3) > -1 || 
              tableauImagesTitle.indexOf(substring4) > -1) &&
              tableauImagesTitle.length > 20 ) ||
              tableauImagesTitle.indexOf(titleHTML) > -1 ) {
            imageTitle = tableauImagesTitle;
            break;
          }
        }

